import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import AuthDetails from './components/AuthDetails';

function App() {
  return (
    <div className="App">
      <Login />
      <Register/>
      <AuthDetails />
    </div>
  );
}

export default App;
